import React, { Component } from 'react'
import logo from "../../assets/images/logo.png";

import Cart from '../cart/Cart';

export default class Header extends Component {
    render() {
        const { items, params } = this.props;

        return (
            <header>
                <nav className="navbar navbar-expand-lg ">
                    <div className="container">
                        <div className="collapse navbar-collapse d-flex justify-content-between" id="navbarNav">
                            <ul className="m-0 d-flex align-items-center pt-3">
                                {items.map((item) => (<li data-testid='category-link' className={params == item.name ? "nav-item active" : "nav-item"} key={item.name}>
                                    <a className="nav-link " aria-current="page" href={"/category/" + item.name} data-testid={params == item.name ? 'active-category-link' : 'category-link'} >{item.name}</a>
                                </li>))}
                            </ul>
                            <div>
                                <a className="navbar-brand" href={items[0].to}>
                                    <img src={logo} alt='logo' />
                                </a>
                            </div>
                            <div className='shoppingCart'>

                                <Cart />
                            </div>
                        </div>
                    </div>
                </nav>
            </header>
        )
    }
}
